import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';
import './monitor.css'
import profLogo from './account.png'
import DropdownSelector from './drop-box-login'; 

import ReactDOM from 'react-dom/client';
import reportWebVitals from './reportWebVitals';

function HomePage(){ 
    const location = useLocation();
    const user = location.state.user; 
    const [glucoseLevel, setGlucoseLevel] = useState('');
    const [reason, setReason] = useState('');

    const handleGlucoseChange = (e) => {
        setGlucoseLevel(e.target.value);
    };

    const handleReasonChange = (e) => {
        setReason(e.target.value);
    };

    const handleGSubmit = () => {
        // Logic to analyze glucose level
        let message = "Your glucose level is normal.";
        if (glucoseLevel < user.glucoseLevels.low) {
        message = "Your glucose level is low.";
        } else if (glucoseLevel > user.glucoseLevels.high) {
        message = "Your glucose level is high.";
        }
        alert(message);
        // ... additional logic to handle reasons and follow-up actions
    };

    //for user input vals ... 
    const [inputValue, setInputValue] = useState(""); // Initialize state for input value

    // Function to handle changes to the input
    const handleChange = (event) => {
      setInputValue(event.target.value); // Update state with input value
    };

    // Function to handle form submission
    const handleSubmit = (event) => {
      event.preventDefault(); // Prevent the default form submit action
      console.log("Submitted value:", inputValue); // Log or handle the submitted value
      // Add actions to use the inputValue, like sending to an API or processing it
    };


    // State to track the current question number
    const [currentQuestion, setCurrentQuestion] = useState(1);
    // State to track answers, initially empty
    const [answers, setAnswers] = useState([]);

    // Function to handle "Yes" button click
    const handleYes = () => {
        const newAnswers = [...answers, 'yes']; // Add 'yes' to the answers array
        setAnswers(newAnswers); // Update the answers state
        // Logic to move to the next question or perform other actions
        setCurrentQuestion(currentQuestion + 1);
    };

    // Function to handle "No" button click
    const handleNo = () => {
        const newAnswers = [...answers, 'no']; // Add 'no' to the answers array
        setAnswers(newAnswers); // Update the answers state
        // Logic to move to the next question or perform other actions
        setCurrentQuestion(currentQuestion + 1);
    };

    // Example of conditional rendering based on the current question and answers
    const renderQuestion = () => {
        if (currentQuestion === 1) {
            return (
                <div className="littleqbox">
                <p className="question">Have you taken your blood sugar reading today?</p>
                <button className="yes-btn" onClick={handleYes}>Yes</button>
                <button className="no-btn" onClick={handleNo}>No</button>
                </div>
            );
        } else if (currentQuestion === 2 && answers[0] === 'no') {
            return (
                <div className="littleqbox">
                <p className="question">Can you please take your blood sugar reading now, and enter it below?</p>
                <button className="yes-btn" onClick={handleYes}>Yes</button>
                <button className="no-btn" onClick={handleNo}>No</button>
                </div>
            );
        } else if (currentQuestion === 2 && answers[0] === 'yes') {
            return (
                <div className="littleqbox">
                    <p className="question">Great! Please enter your reading.</p>
                    <form onSubmit={handleSubmit}>
                        <label htmlFor="textInput">Enter Text:</label>
                        <input
                        type="text"
                        id="textInput"
                        value={inputValue}
                        onChange={handleChange}
                        />
                        <button type="submit">Submit</button>
                    </form>
                </div>
            );
        } else if(currentQuestion === 3 && answers[1] === 'yes'){ 
            return (
                <div className="littleqbox">
                <p className="question">Great! Please enter your reading.</p>
                {/* Input for reading */}
                </div>
            );
        }
        // Continue adding else-if blocks for further questions
  };
    return (
        <div>
            <header> 
                <nav className = "navBar"> 
                    <div className = "nav-cont"> 
                        <div className = "nav-elements"> 
                            <ul> 
                                <li> 
                                    <img className ="profileIcon"style={{width: 70, height: 70}}src = {profLogo}/> 
                                </li> 
                                <li> 
                                    <div className = "Name">{user.name}</div> 
                                    <div className = "ID">ID: {user.id}</div>
                                </li>
                                <li> 
                                    <button className = "logout">Log out</button>
                                </li> 
                            </ul> 
                        </div>  
                    </div>
                </nav>
            </header>
            <div className = "monitorpage"> 
                <div className = "q-container">
                    <p className = "title">Blood Glucose Monitoring</p>
                    <p className = "lil-title">Please answer the following question(s).</p>
                    {renderQuestion()}
                </div>
            </div> 
        </div>

    );
}
export default HomePage;
